  summary: "\nSerializable dictionary.\nThis class works as a regular dictionary. The only restriction is that the string is a value type\n"
  remarks: "\nSerializes a dictionary to and from XML. Used as part of the data-carriers.\n"
  example:
  - "\n<pre><code> StringDictionary dict = new StringDictionary();\n dict[&quot;foo&quot;] = &quot;bar&quot;;\n dict[&quot;baz&quot;] = &quot;quux&quot;;\n dict.WriteXml( xmlWriter );</code></pre>\nresults in XML that looks like this:\n<pre><code>  &lt;StringDictionary>\n     &lt;StringKeyValuePair>\n        &lt;Key>foo&lt;/Key>&lt;Value>bar&lt;/Value>\n     &lt;/StringKeyValuePair>\n     &lt;StringKeyValuePair>\n        &lt;Key>baz&lt;/Key>&lt;Value>quux&lt;/Value>\n     &lt;/StringKeyValuePair>\n  &lt;/StringDictionary></code></pre>\n"
